import './Search.css';

function Search() {
  return (
    <div className="Search">
      <header className="Search-header">
        <title>DicomWebViewer</title>
        <h1>DicomWebViewer App</h1>
      </header>
      <body>
        <div>
            <input type="checkbox" id="scales" name="scales" checked></input>
            <label for="scales">Orthanc Server</label>
        </div>
      </body>
    </div>
  );
}

export default Search;
